import { useState } from "react"

const Register = () => {
    const [data, setData] = useState({
        phone: '',
        message: '',
        status: ''
    })

    const handleChange = (e) => {
        console.log(e)
    }

    return(
        <section className="row">
            <h1>Register</h1>
            <div className="col-md-6 mx-auto">
                <form>
                    <div className="form-group">
                        <input
                        type="text"
                        name="phone"
                        value={data.phone}
                        onChange={handleChange}
                        />
                    </div>
                </form>
            </div>
        </section>
    )
}

export default Register
